import React, { useState } from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'
import Navbar from './components/Navbar/Navbar';
import SeeAll from './components/Pages/SeeAll';
import Home from './components/Pages/Home';
import SeeSingle from './components/Pages/SeeSingle';

const DUMMYLIST = [
  {name:'Mike', address:'marry popin land', id:0},
  {name:'Nancy', address:'Cherry Street', id:1},
  {name:'Deluka', address:'Hogwarts', id:2},
  {name:'DeNice', address:'Never land', id:3},

]
function App() {
  const [list, setList] = useState(DUMMYLIST)
  return (
    <Router>
    <Navbar/>
      <Routes>
        <Route path='/home' element={<Home/>}/>
        <Route path='/seeAll' element={<SeeAll list={list} />}/>
        <Route path='/seeAll/:id' element={<SeeSingle list={list} />}/>
        <Route path='/seeAll/:id' element={<SeeSingle list={list} />}/>

      </Routes>
    </Router>
  );
}

export default App;
